import React from 'react';
import PropTypes from 'prop-types';
import { css } from 'emotion';

const propTypes = {
  score: PropTypes.string,
};

const ScoreComp = (props) => {
  return (
    <div className={styles.root}>
      ScoreComp
    </div>
  );
};

const styles = {
  root: css({})
};

ScoreComp.propTypes = propTypes;

export default ScoreComp;
